<template>
  <div>
    <!--左边题目工具栏 展示可拖动创建题目的元素 -->
    <div id="question-draggable-wrap">
      <!-- 基本题型 -->
      <h3 style="font-weight: bold">基本题型</h3>
      <ul>
        <li class="radio-bg">
          <div class="tool-title" title="单选题"></div>
          <div class="tool-body">
            <ul>
              <li class="draggable tool" data-id="" data-type="3">
                <div class="q-header"><span class="num"></span>、 <input name="" style="width: 90%" type="text" value="题目标题" /></div>

                <div class="q-body">
                  <div>
                    <span>
                      <input name="" type="radio" />
                      <input name="" type="text" value="选项1" />
                      <i class="el-icon-remove del-option-btn" title="移除选项" onclick="delOption(this)"></i>
                      <br />
                    </span>
                    <span>
                      <input name="" type="radio" />
                      <input name="" type="text" value="选项2" />
                      <i class="el-icon-remove del-option-btn" title="移除选项" onclick="delOption(this)"></i>
                      <br />
                    </span>
                  </div>
                </div>
                <!-- 题目操作区域 -->
                <div class="btn-group">
                  <button class="q-del-btn" onclick="qDel(this,'0')">
                    <i class="el-icon-error"></i>
                    删除问题
                  </button>
                  <button class="q-add-option-btn" onclick="addOption(3,this)">
                    <i class="el-icon-circle-plus"></i>
                    添加选项
                  </button>
                </div>
              </li>
            </ul>
          </div>
        </li>
        <li class="checkbox-bg">
          <div class="tool-title" title="多选题"></div>
          <div class="tool-body">
            <ul>
              <!-- 多选题 -->
              <li class="draggable tool" data-id="" data-type="4">
                <div class="q-header">
                  <span class="num"></span>、
                  <input name="" style="width: 90%" type="text" value="题目标题" />
                </div>
                <div class="q-body">
                  <span>
                    <input name="" type="checkbox" />
                    <input name="" type="text" value="选项1" />
                    <i class="el-icon-remove del-option-btn" title="移除选项" onclick="delOption(this)"></i>
                    <br />
                  </span>
                  <span>
                    <input name="" type="checkbox" />
                    <input name="" type="text" value="选项2" />
                    <i class="el-icon-remove del-option-btn" title="移除选项" onclick="delOption(this)"></i>
                    <br />
                  </span>
                </div>
                <!-- 题目操作区域 -->
                <div class="btn-group">
                  <button class="q-del-btn" onclick="qDel(this,'0')">
                    <i class="el-icon-error"></i>
                    删除问题
                  </button>
                  <button class="q-add-option-btn" onclick="addOption(4,this)">
                    <i class="el-icon-circle-plus"></i>
                    添加选项
                  </button>
                </div>
              </li>
            </ul>
          </div>
        </li>
        <li class="input-bg">
          <div class="tool-title" title="单行填空题"></div>
          <div class="tool-body">
            <ul>
              <!-- 单行填空题 -->
              <li class="draggable tool" data-id="" data-type="1">
                <div class="q-header">
                  <span class="num"></span>、
                  <input name="" style="width: 90%" type="text" value="题目标题" />
                </div>
                <div class="q-body">
                  <input name="" type="text" placeholder="填写问题提示" />
                </div>
                <!-- 题目操作区域 -->
                <div class="btn-group">
                  <button class="q-del-btn" onclick="qDel(this,'0')">
                    <i class="el-icon-error"></i>
                    删除问题
                  </button>
                </div>
              </li>
            </ul>
          </div>
        </li>
        <li class="textarea-bg">
          <div class="tool-title" title="多行填空题"></div>
          <div class="tool-body">
            <ul>
              <li class="draggable tool" data-id="" data-type="2">
                <div class="q-header">
                  <span class="num"></span>、
                  <input name="" style="width: 90%" type="text" value="题目标题" />
                </div>
                <div class="q-body">
                  <textarea style="width: 100%" placeholder="填写问题提示"></textarea>
                </div>
                <!-- 题目操作区域 -->
                <div class="btn-group">
                  <button class="q-del-btn" onclick="qDel(this,'0')">
                    <i class="el-icon-error"></i>
                    删除问题
                  </button>
                </div>
              </li>
            </ul>
          </div>
        </li>
      </ul>
      <h3 style="font-weight: bold">辅助组件</h3>
      <ul>
        <li class="line-bg">
          <div class="tool-title" title="分割线"></div>
          <div class="tool-body">
            <ul>
              <li class="draggable tool" data-id="" data-type="5">
                <div class="q-body">
                  <hr />
                </div>
                <!-- 题目操作区域 -->
                <div class="btn-group">
                  <button class="q-del-btn" onclick="qDel(this,'0')">
                    <i class="el-icon-error"></i>
                    删除分割线
                  </button>
                </div>
              </li>
            </ul>
          </div>
        </li>
      </ul>
    </div>
    <!-- 题目展示区（拖动题目放置的目标区） -->
    <div id="question-container">
      <h3 class="text-center text-primary" v-if="isNaN(tid)">该问卷已被删除或不存在！</h3>
      <div class="text-right" v-if="t !== null">
        <div>
          <el-input class="title-input" :maxlength="100" :minlength="1" :show-word-limit="true" type="text" v-model="t.name" />
        </div>
        <div style="margin:10px 0">
          <span v-text="'创建日期：' + t.createDate"></span>
        </div>
        <hr style="height:1px;border:none;border-top:2px dotted #ccc;" />
      </div>
      <ul id="questions">
        <li class="draggable tool" v-for="qe in t.questions" :data-id="qe.id" :data-type="qe.questionType" :key="qe.id">
          <div class="q-header" v-if="qe.questionType !== 5">
            <span class="num" v-text="qe.questionNum"></span>、
            <input name="" style="width: 90%" :value="qe.questionTitle" type="text" />
          </div>
          <div class="q-body">
            <input name="" v-if="qe.questionType === 1" :value="qe.inputPlaceholder" type="text" />
            <textarea cols="10" style="width: 100%" v-if="qe.questionType === 2" :value="qe.inputPlaceholder"></textarea>
            <div v-if="qe.questionType === 3">
              <span v-for="qo in qe.options" :key="qo.id">
                <input name="" type="radio" />
                <input name="" :id="qo.id" :value="qo.optionText" type="text" />
                <i class="el-icon-remove del-option-btn" title="移除选项" :onclick="'delOption(this,' + qo.id + ')'"></i>
                <br />
              </span>
            </div>
            <div v-if="qe.questionType === 4">
              <span v-for="qo in qe.options" :key="qo.id">
                <input name="" type="checkbox" />
                <input name="" :id="qo.id" :value="qo.optionText" type="text" />
                <i class="el-icon-remove del-option-btn" title="移除选项" :onclick="'delOption(this,' + qo.id + ')'"></i>
                <br />
              </span>
            </div>
            <hr v-if="qe.questionType === 5" />
          </div>
          <div class="btn-group">
            <button class="q-del-btn" :onclick="'qDel(this,' + qe.id + ')'">
              <i class="el-icon-error"></i>
              {{ qe.questionType === 5 ? '删除分割线' : '删除问题' }}
            </button>
            <button class="q-add-option-btn" v-if="qe.questionType === 3 || qe.questionType === 4" :onclick="'addOption(' + qe.questionType + ', this)'">
              <i class="el-icon-circle-plus"></i>
              添加选项
            </button>
          </div>
        </li>
      </ul>
    </div>
    <!-- 操作按钮区 -->
    <div style="position: fixed;top:100px;right: 20px;width: 200px">
      <el-button type="primary" style="width: 100%" @click="saveChange">保存</el-button>
      <br /><br />
      <el-button v-if="t.status === 0" type="warning" style="width: 100%" @click="publish">发布</el-button>
    </div>
  </div>
</template>

<script>
import { setWindowTitle } from '@/utils'
import $ from 'jquery'
import 'jquery-ui-dist/jquery-ui'
import 'jquery-ui-dist/jquery-ui.min.css'
export default {
  name: 'TemplateDesign',
  data() {
    return { tid: NaN, t: {} }
  },
  methods: {
    /**
     * 获取调查问卷模板信息和问题选项
     */
    getTemplateDetail() {
      this.$http.get('/template/detail?tid=' + this.tid).then(resp => {
        let data = resp.data
        if (data.code === 0) {
          this.t = data.data
          setWindowTitle('调查问卷模板设计-' + this.t.name)
        } else {
          this.$message.error('获取调查问卷模板数据失败！')
        }
      })
    },
    /**
     * 保存调查问卷模板
     */
    saveChange() {
      if (isNaN(this.tid)) return
      let tId = this.tid
      let tName = this.t.name
      if (tName === undefined || tName.trim() === '') {
        this.$message.error('请输入调查问卷模板名称')
        return
      }
      let questionDomList = $('#questions').children()
      let questions = []
      $.each(questionDomList, function(i, item) {
        var qId = $(item).data('id') //题目id
        var qType = $(item).data('type') //题目类型
        var qOrder = i + 1 //题目排序号
        var qNum = $(item)
          .find('.q-header .num ')
          .text() //题目题号
        var qTitle = $(item)
          .find('.q-header input ')
          .val() //题目标题
        var qOptions = [] //题目选项数组，只对单复题有效
        var inputPlaceholder = '' //input表单的placeholder，用于提示用户，只对填空题有效
        if (qType == 1) {
          //单行填空题
          inputPlaceholder = $(item)
            .find('.q-body input ')
            .val()
        } else if (qType == 2) {
          //多行填空题
          inputPlaceholder = $(item)
            .find('.q-body textarea')
            .val()
        } else if (qType == 3 || qType == 4) {
          //单选和多选题 获取选项
          var optionInput = $(item).find('.q-body input[type=text]')
          for (let i = 0; i < optionInput.length; i++) {
            var optionId = $(optionInput[i]).attr('id')
            if (optionId === undefined) optionId = ''
            qOptions.push({ id: optionId, optionText: $(optionInput[i]).val(), optionOrder: i + 1 })
          }
        } else if (qType == 5) {
          //辅助组件分割线
          qTitle = '分割线'
        }
        var question = {
          id: qId,
          questionType: qType,
          questionOrder: qOrder,
          questionNum: qNum,
          questionTitle: qTitle,
          options: qOptions,
          inputPlaceholder: inputPlaceholder
        }
        questions.push(question)
      })
      let template = {
        id: tId,
        name: tName,
        questions: questions
      }
      console.log(template)
      this.doSaveTemplate(template)
    },
    /**
     * 保存调查问卷模板数据到数据库
     */
    doSaveTemplate(template) {
      let loading = this.$loading({
        lock: true,
        text: '正在保存，请稍候',
        spinner: 'el-icon-loading',
        background: 'rgba(0, 0, 0, 0.7)'
      })
      this.$http.post('/template/design/save', template).then(resp => {
        let data = resp.data
        if (data.code === 0) {
          //清理通过DOM添加的选项（不清除页面上会显示双份且下次保存的时候会重复）
          $('#questions .q-body div span>input[value]:not([id])')
            .parent()
            .remove()
          this.$message.success('保存成功！')
          this.getTemplateDetail()
        } else {
          this.$message.error('保存失败！' + data.msg)
        }
        loading.close()
      })
    },

    publish() {
      this.saveChange() //发布之前先保存
      let questionnaireId = $('#questionnaire-id')
      if (questionnaireId == undefined) return
      $.post('/questionnaire/design/publishQuestionnaire/', { questionnaireId: questionnaireId.val() }, function(data) {
        if (data.code === 200) {
          this.$message.success('发布成功！')
          window.location.href = '/questionnaire/share?qId=' + questionnaireId.val()
        } else {
          this.$message.error('发布失败！' + data.msg)
        }
      }).fail(function() {
        this.$message.error('发布失败，请稍后重试！')
      })
    },

    initDrag() {
      let _self = this
      $('#questions')
        .sortable({
          cursor: 'move',
          opacity: 0.5,
          stop: function() {
            var list = $(this).children()
            _self.updateQuestionIndex(list) //排序结束，更新问题题号
          }
        })
        .droppable({
          drop: function() {
            debugger
          }
        })
      $('#question-draggable-wrap > ul > li').draggable({
        addClasses: false,
        cursor: 'move',
        zIndex: 2000,
        opacity: 0.5,
        scroll: true,
        scrollSensitivity: 30,
        scrollSpeed: 30,
        appendTo: '#questions',
        helper: function() {
          return $(this)
            .find('.tool-body  ul li')
            .clone()
        },
        connectToSortable: '#questions'
      })
    },
    //更新问题题号
    updateQuestionIndex(list) {
      var index = 0
      var num = 0
      $.each(list, function(i, item) {
        $(item).removeAttr('style')
        $(item).attr('data-order', ++index)
        var type = $(item).data('type')
        if (type != 5) {
          $(item)
            .find('span.num')
            .html(++num)
        }
      })
    },

    /**
     * 问题删除,先删除DOM，如果问题在数据库存在，则再删除数据库中该问题数据
     */
    qDel(e, qId) {
      e.parentNode.parentNode.parentNode.removeChild(e.parentNode.parentNode)
      console.log(qId)
      var list = $('#questions').children()
      this.updateQuestionIndex(list) //删除问题，重新更新问题题号
      if (qId === undefined || qId === '' || qId === '0') {
        return
      }
      this.doDeleteQuestion(this.tid, qId)
    },

    /**
     * 删除数据库中的问题
     * @param tid 模板id
     * @param qid 问题id
     */
    doDeleteQuestion(tid, qid) {
      this.$http.post('/template/design/delQuestion?tid=' + tid + '&qid=' + qid).then(resp => {
        let data = resp.data
        if (data.code === 0) {
          this.$message.success('删除成功！')
        } else {
          this.$$message.error('删除失败！')
        }
      })
    },

    /**
     * 问题添加新的选项，只是在添加DOM并不在数据库添加，
     * 当保存时再统一更新问题选项
     * @param type 问题类型
     * @param e 触发点击事件的元素
     */
    addOption(type, e) {
      var qBody = $(e)
        .parent()
        .parent()
        .find('.q-body')[0].children[0]
      var content = ''
      if (type === 3) {
        //单选题
        content =
          '<span>' +
          '<input name="" type="radio">' +
          '<input name="" type="text" value="选项"> ' +
          '<i class="el-icon-remove del-option-btn"  title="移除选项" onclick="delOption(this)"></i>' +
          '<br>' +
          '</span>'
      } else if (type === 4) {
        //多选题
        content =
          '<span>' +
          '<input name="" type="checkbox">' +
          '<input name="" type="text" value="选项"> ' +
          '<i class="el-icon-remove del-option-btn" title="移除选项" onclick="delOption(this)"></i>' +
          '<br>' +
          '</span>'
      }
      $(qBody).append(content)
    },
    /**
     * 删除问题选项，先删除DOM，
     * 如果该选项是数据库中存在的，则删除再删除数据库中的数据
     * @param e 触发点击事件所在dom
     * @param oid 选项id
     */
    delOption(e, oid) {
      e.parentNode.parentNode.removeChild(e.parentNode)
      if (oid !== undefined && oid !== '' && oid !== '0') {
        this.$http.post('/template/design/delOption?oid=' + oid).then(resp => {
          let data = resp.data
          if (data.code === 0) {
            this.$message.success('选项已删除！')
          } else {
            this.$message.error(data.msg)
          }
        })
      } else {
        this.$message.success('选项已删除！')
      }
    }
  },
  mounted() {
    this.tid = this.$route.query.tid
    this.getTemplateDetail()
    this.initDrag()
    setWindowTitle('调查问卷模板设计')
    window.delOption = this.delOption
    window.qDel = this.qDel
    window.addOption = this.addOption
  }
}
</script>

<style>
.text-primary {
  color: #1e9fff;
}
.text-dark-gray {
  color: #5a5a5a;
}
.text-gray {
  color: #c2c2c2;
}
.text-dark {
  color: #000;
}
.text-danger {
  color: #ff5722;
}
a[class~='text-primary']:hover {
  color: #1598f8;
}

.text-center {
  text-align: center;
}
.text-left {
  text-align: left;
}
.text-right {
  text-align: right;
  display: block;
}
/*自定义背景颜色*/
.bg-primary {
  color: #fff;
  background-color: #1e9fff;
}
.bg-white {
  color: #0c0c0c !important;
  background-color: #fff;
}
/* 全局基本样式*/
li {
  list-style: none;
}
.draggable {
  cursor: move;
}

/*问题快捷拖拽区域*/
#question-draggable-wrap {
  position: fixed;
  left: 0;
  padding: 10px;
  top: 100px;
  width: 90px;
  margin: 0 auto;
  background-color: #ffffff;
  box-shadow: 0 0 5px #ccc;
}
#question-draggable-wrap ul li {
  display: block;
  width: 50px;
  height: 50px;
  background-size: contain;
  cursor: move;
}
#question-draggable-wrap ul li:hover {
  box-shadow: 0 0 5px #ccc;
}

#question-container {
  position: absolute;
  width: 760px;
  padding: 20px 40px;
  background: white;
  z-index: 1;
  top: 10px;
  bottom: 0;
  left: 50%;
  margin-left: -380px;
  overflow-y: scroll;
}
/* 问题展示区样式 */
#question-container li {
  display: block;
  margin: 10px 20px;
  width: 90%;
  padding: 5px;
  position: relative;
}
#question-container li:hover {
  background-color: #ccc;
}
#question-container li div.btn-group {
  text-align: center;
  display: none;
}
#question-container li div.btn-group button:first {
  border-right: 0;
}
#question-container li div.btn-group:last-child button {
  border-left: 0;
}
#question-container li:hover div.btn-group {
  display: block;
}
#questions {
  min-height: 600px;
}
#questions li div {
  margin-bottom: 5px;
}
.q-header {
  width: 100%;
}
.q-header input {
  font-size: 15px;
  height: 30px;
  outline: none;
  border: 1px rgba(0, 0, 0, 0) solid;
}
.q-header input:hover,
.q-header input:focus {
  border: 1px #ccc solid;
  border-radius: 5px;
}
.q-body {
  margin-left: 10px;
}
.q-body input {
  margin-bottom: 8px;
}
.del-option-btn {
  margin-left: 10px;
  color: #c9221f;
  display: none;
  cursor: pointer;
}
button {
  border: 1px #ccc solid;
  cursor: pointer;
  padding: 5px;
}
.q-del-btn {
  background: #c9221f;
  color: white;
}
.tool-body {
  display: none;
}
.q-body span:hover .del-option-btn {
  display: inline;
  font-size: 18px;
}
/* 顶部各题目背景样式 */
.radio-bg {
  background: transparent
    url('data:image/bmp;base64,')
    no-repeat;
}
.input-bg {
  background: transparent
    url('data:image/bmp;base64,')
    no-repeat;
}
.checkbox-bg {
  background: transparent
    url('data:image/bmp;base64,')
    no-repeat;
}
.textarea-bg {
  background: transparent
    url('data:image/bmp;base64,')
    no-repeat;
}
.line-bg {
  background: transparent
    url('data:image/bmp;base64,')
    no-repeat;
}

/* 通知div */
.notify-div {
  position: absolute;
  top: 20%;
  right: 10%;
  min-width: 200px;
  height: 40px;
  line-height: 40px;
  text-align: center;
  background-color: white;
  border: 1px #ccc solid;
  border-radius: 5px;
  z-index: 2000;
}
.notify-div.success {
  color: #3c763d;
  background-color: #dff0d8;
  border-color: #d6e9c6;
}
.notify-div.info {
  color: #31708f;
  background-color: #d9edf7;
  border-color: #bce8f1;
}

.notify-div.warning {
  color: #8a6d3b;
  background-color: #fcf8e3;
  border-color: #faebcc;
}
.notify-div.error {
  color: #a94442;
  background-color: #f2dede;
  border-color: #ebccd1;
}
</style>
<style>
.title-input input[type='text'] {
  color: #1598f8;
  font-size: 25px;
  text-align: center;
}
</style>
